import { littleLeif } from '..img/moi 1.jpg'

const Homepage = () => {
    return(
        <div className="homepage">
            <body>
                <main>
                    <section className="glass">
                        <img src={littleLeif} alt="une photo de moi enfant"/>
                    </section>
                </main>
            </body>
        </div>
    )
}

export default Homepage;
